import React, { useEffect, useState } from 'react'
import { makeStyles } from '@material-ui/core/styles'

const Marker = props => {
  const [marker, setMarker] = useState({})

  const initMarker = () => {
    const marker = new google.maps.Marker({position: { lat: 35.2271, lng: -80.8431 },map: props.map})
    setMarker(marker)
  }

  useEffect(() => {
    initMarker()

    return () => {
    }
  }, [])

  return (
    <div />
  )
}

export default Marker
